export class DominionWarUniformPack extends BaseTngEraUniformPack implements IUniformPack {

    getUniformSwatches() {
        return [
            new Swatch(BodyType.AverageMale, "Average Male", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageMale, token.skinColor, undefined, UniformEra.DominionWar) + DominionWarMaleBody, BodyType.AverageMale, token), "BodyType.averageMale"),
            new Swatch(BodyType.AverageFemale, "Average Female", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageFemale, token.skinColor, undefined, UniformEra.DominionWar) + DominionWarFemaleBody, BodyType.AverageFemale, token), "BodyType.averageFemale"),
        ];
    }

    getUniformVariantSwatches(token: Token) {
        return [];
    }

    getUniformAndVariantBody(token: Token) {
        if (token.bodyType === BodyType.AverageMale) {
            return this.getNeck(token.bodyType, token.skinColor, token.species, UniformEra.DominionWar) + DominionWarMaleBody.replace(DefaultRed, token.divisionColor).replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
        } else {
            return this.getNeck(token.bodyType, token.skinColor, token.species, UniformEra.DominionWar) + DominionWarFemaleBody.replace(DefaultRed, token.divisionColor).replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
        }
    }

    getRankIndicator(token: Token) {
        let result = super.getRankIndicator(token);
        result = `<g transform="translate(3, 5)">` + result + `</g>`;
        return result;
    }
}